import GreenPageHeader from '../../../components/common/GreenPageHeader';
import { Marker } from "react-simple-maps"
import React from 'react'
import GoogleMapReact from 'google-map-react'
import './map.css'
import { Icon } from '@iconify/react'
import locationIcon from '@iconify/icons-mdi/map-marker'

const titleStyle = {
    fontFamily: 'Lemonada',
    textTransform: 'uppercase',
    fontWeight: 700,
    fontSize: '18px',
};

const ContactUsContainer = () => {
    const location = {
        address: 'Grocery Shop center',
        lat: 47.019982,
        lng: 28.821268,
    }

    const LocationPin = ({ text }) => (
        <div className="pin">
            <Icon icon={locationIcon} className="pin-icon" />
            <p className="pin-text">{text}</p>
        </div>
    )

    const Map = ({ location, zoomLevel }) => (
        <iframe
            src="https://www.google.com/maps/embed?pb=!1m14!1m12!1m3!1d595.3283242877167!2d28.821288768945422!3d47.0196887958805!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!5e0!3m2!1sru!2s!4v1683375635027!5m2!1sru!2s"
            width="600" height="450" style="border:0;" allowFullScreen="" loading="lazy"
            referrerPolicy="no-referrer-when-downgrade"></iframe>
    )

  return (
    <>
      <GreenPageHeader title="Contact us" />
        <Map location={location} zoomLevel={17} />
    </>
  );
};

export default ContactUsContainer;
